const getTheTitles = function(x) {
    return x.map((a) => a.title);    
};
//'a' is representative of the object in the array 'x'
//'a' can be named anything
//'title' is a key in the object 'a', so 'a.title' is kind of like title is the index 

// Do not edit below this line
module.exports = getTheTitles;
